  "hasCellar": true,
  "description": "We offer for sale a 4-room apartment in Žilina, in a quiet and popular area called Malá Praha, specifically in the Hliny 8 district. This is an apartment in its original condition (with high-quality plastic windows, balconies, and kitchen unit replaced) in an insulated brick building. The new owner can renovate the apartment according to their own ideas. Located on the second of three floors, and the building has no elevator. The advantage is a private gas boiler, the water is heated by a boiler, and there is also a laundry room with an iron in the building. The living area of the apartment is approximately 76 m2, and it includes 3 balconies of 10 m2 and a brick cellar of 8 m2. There is also the option to purchase a remote-controlled garage with an area of approximately 20 m2 for the amount of 35000 € . The location is highly appreciated by those who know it, as it is a quiet, safe, and popular area full of greenery and in close proximity to complete civic amenities. City center of Žilina is approximately a 5-minute walk away. Monthly costs: up to 200 € The total price of the apartment is 205000 €, negotiable The price includes complete legal and financial services, fees, free processing of the contract related to the transfer of ownership rights, purchase and sale agreements, and free registration in the cadastre included in the price. We also offer free assistance in obtaining a more favorable mortgage loan or refinancing."
}

